import React, { Component } from 'react';
import './App.css';

import Start from '../components/Start/Start';
import NumberSeries from '../components/NumberSeries/NumberSeries';

class App extends Component {

	constructor(props) {

		super(props);

		this.state = {
			isStartClicked : false
		}

        this.clickStart = this.clickStart.bind(this);

	}

	clickStart = () => {
		this.setState({
			isStartClicked : true
		});
	}

	render() {
		return (
			<div className="App">
				<NumberSeries />
			</div>
		);
  	}
}

export default App;
